:root {
	--width: 672px;
	--height: 966px;
	--halfW: 336px;
	--quatW: 168px;
}
*, ::before, ::after {
	box-sizing: border-box;
	padding: 0;
	margin: 0;
}

/*
	main 672*966
	card 744*1038
	total 816*1110
*/

html, body {
/*	font-family: Zapfino;
