	font-family: Hiragino Maru Gothic ProN;
	font-family: YuKyokasho;*/
	font-family: Tsukushi A Round Gothic;
}
body {
	display: flex;
	justify-content: center;
	align-items: center;
	min-width: 816px;
	min-height: 1110px;
}
.container {
	position: relative;
	display: flex;
	justify-content: center;
	align-items: center;
	width: 816px;
	height: 1110px;
	margin: auto;
	background-size: 100% auto;
	background-color: #013;
	overflow: hidden;
}
.container::before {
	/*content: '';*/
	position: fixed;
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	background-image: url(bg.png);
	background-size: cover;
	opacity: .1;
}
.frame {
	position: relative;
	width: var(--width);
	height: var(--height);
	overflow: hidden;
}

